////////// 1. Prepare the input imagery for model////////////
function addNDVIdoy(image) {
    var ndvi = image.normalizedDifference(['N', 'R']).rename('NDVI')
    var evi2 = image.expression(
        '2.5 * ((NIR - RED) / (NIR +2.4 * RED  + 1))', {
        'NIR': image.select('N'),
        'RED': image.select('R'),
        'BLUE': image.select('B')
    }).rename("EVI2").toFloat()
    var evi = image.expression(
        '2.5 * ((NIR - RED) / (NIR +6 * RED  -7.5*BLUE+1))', {
        'NIR': image.select('N'),
        'RED': image.select('R'),
        'BLUE': image.select('B')
    }).rename("EVI").toFloat()
    var doy = image.date().getRelative('day', 'year');
    var doyBand = ee.Image.constant(doy).uint8().rename('doy');
    return image.set('doy', doy).addBands(ndvi).addBands(evi2).addBands(doyBand);

}

function napiimage(year) {
    var dataset = ee.ImageCollection('USDA/NAIP/DOQQ')
        .filterBounds(roi)
        .filter(ee.Filter.date(year + '-01-01', year + '-12-30'))
        .map(addNDVIdoy)
    var composite = dataset.qualityMosaic('EVI2')
    var epsg3310 = ee.Projection('EPSG:4326')
    var composite = composite.reproject({
        crs: epsg3310,
        scale: 1
    })
    return composite
}


function nom(img) {

    var R = (img.select('R')).divide(ee.Image(255))
    var G = (img.select('G')).divide(ee.Image(255))
    var B = (img.select('B')).divide(ee.Image(255))
    var N = (img.select('N')).divide(ee.Image(127))
    return R.addBands(G).addBands(B).addBands(N)

}

